const actions = {
	doSomething: function(argument) {
		return {
			type: "DO_SOMETHING",
			payload: argument,
		}
	},
	peelThePotato: function(chicken) {
		return {
			type: "PEEL_THE_POTATO",
			payload: chicken,
		}
	},
	requestToDatabase: function(chicken) {
		return {
			type: "REQ_TO_DATABASE",
			payload: chicken,
		}
	},

}

export function peelThePotato(chicken) {
	return {
		type: "PEEL_THE_POTATO",
		payload: chicken,
	}
}

export default actions;
